// App.js
import React from 'react';
import Page1 from './Page1';
import Page2 from './Page2';
import { Routes, Route } from 'react-router-dom';

const App = () => {
  return (
    <UserProvider>
   <Page1/>
    <Routes>
      <Route path="Page2" element={<Page2 />} />
    </Routes>
</UserProvider>
  );
};

export default App;
